import React, { useCallback, useEffect, useMemo, useState } from "react";
import "react-day-picker/lib/style.css";
import ImageStorage from "../../models/imageStorage";
import ResponseBase from "../../models/ResponseBase";
import api from "../../services/api";

import {
  Container,
  Header,
  HeaderContent,
  Profile,
  Content,
  ImagesProfile,
  NextBaseUrlImage,
} from "./styles";

const Dashboard: React.FC = () => {

  const [images, setImages] = useState<ImageStorage[]>([]);

  useEffect(() => {
    api
      .get<ResponseBase<ImageStorage[]>>(`/api/v1/images`, {})
      .then((response) => {
        setImages(response.data.data);
      });
  }, []);

  return (
    <Container>
      <Header>
        <HeaderContent>
          <Profile>
            <div>
              <span>Bem-vindo,</span>
              <strong> 55PBX </strong>
            </div>
          </Profile>
        </HeaderContent>
      </Header>

      <Content>
        <ImagesProfile>
          <h1>Imagens capturadas</h1>

          <NextBaseUrlImage>
            <div>
              <img src="https://m.media-amazon.com/images/M/MV5BYjE0NTMxMzMtM2U2YS00N2UwLTkxMmEtZjUzZWUyOWVmOThkXkEyXkFqcGdeQXZ3ZXNsZXk@._V1_QL40_QL75_UX500_CR0,0,500,281_.jpg" />
              <strong>https://globo.com</strong>
            </div>
          </NextBaseUrlImage>

          <NextBaseUrlImage>
            <div>
              <img src="https://m.media-amazon.com/images/M/MV5BYjE0NTMxMzMtM2U2YS00N2UwLTkxMmEtZjUzZWUyOWVmOThkXkEyXkFqcGdeQXZ3ZXNsZXk@._V1_QL40_QL75_UX500_CR0,0,500,281_.jpg" />
              <strong>https://globo.com</strong>
            </div>
          </NextBaseUrlImage>
        </ImagesProfile>
      </Content>
    </Container>
  );
};

export default Dashboard;
